import React, {useState, Component} from 'react';
import {TextField} from "@material-ui/core";


class NumberField extends Component{

    render(){ 
        return (
        <TextField
          label="None"
          id="margin-none"
          label={this.props.label}
          defaultValue={0}
          helperText="Introduce valor"
          variant="outlined"
          type={Number}
        />
        )
    }
}

export default NumberField;
